import React, {  useEffect, useState } from "react";

const App = () => {
    const[num, setNum] =  useState(0);
    //const[nums, setNums] =  useState(0);

useEffect (() => {
    document.title=`clicked ${num}`;
});

    return(
        <>
         <button onClick={(() => {
            setNum(num +1);
         })
         }
         >
            Click Me{num}
         </button>
         
         </>

    );
}

export default App;
